import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  width: 100%;
  max-width: 1200px;
  margin: 0 auto;
`;

export const Aside = styled.aside`
  width: 240px;
`;

export const Newsfeed = styled.main`
  flex: 1;
  margin: 0 40px;
`;
